// scroll navbar

function NavbarScroll({ isScrolling, setIsModalOpen }: any) {
  return (
    <motion.nav
      key={1}
      initial="initial"
      animate={isScrolling ? "animate" : "initial"}
      exit="exit"
      variants={NavAnimations}
      className="bg-secondary-dark fixed top-0 left-0 w-full z-30  "
    >
      <Header setIsModalOpen={setIsModalOpen} />
    </motion.nav>
  );
}

const NavAnimations = {
  initial: {
    y: -50,
    opacity: 0,
  },
  animate: {
    y: 0,
    opacity: 1,
    transition: {
      type: "spring",
      damping: 10,
      stiffness: 30,
    },
  },
  exit: {
    y: -50,
    opacity: 0,
    transition: {
      type: "spring",
      damping: 10,
      stiffness: 70,
    },
  },
};
